import React from "react";
import ItemCard from "./ItemCard";
import { Link } from "react-router-dom";
class Home extends React.Component {
  render() {
    const { list } = this.props;
    return (
      <>
        <Link to="/cart">Go to cart</Link>
        <div>
          {list.map(item => (
            <ItemCard item={item} key={item.id} />
          ))}
        </div>
      </>
    );
  }
}

export default Home;
